//Data string url needed for adding logo to pdf: website used for conversion: https://ezgif.com/image-to-datauri
var RRL = "data:image/png;base64,";
// ! sign
var sign = "data:image/jpeg;base64,";

/* Converts form information into PDF */
function pdf() {
    //* Basics
    var date = document.getElementById('date').value;
    var months = ["Jan.", "Feb.", "Mar.", "Apr.", "May", "June", "July", "Aug.", "Sept.", "Oct.", "Nov.", "Dec."];
    var tempDate = date.split("-");
    date = months[tempDate[1]-1] + " " + tempDate[2] + ", " + tempDate[0];
    var RDVM = document.getElementById('rdvm').value;
    if (RDVM == "Other") {
        RDVM = 'Dr. ' + document.getElementById('otherRDVM').value;
    }
    var patName = document.getElementById('patientName').value;
    var ownName = document.getElementById('ownerName').value;
    var patHistory = document.getElementById('history').value;

    //* Patient Information
    var gender = document.getElementById('gender').value;
    var age = document.getElementById('age').value;
    var breed = document.getElementById('breed').value;
    if (breed == "Other") {
        breed = document.getElementById('otherBreed').value;
    }
    var species = document.getElementById('species').value;
    if (species == "Other") {
        species = document.getElementById('otherSpecies').value;
    }

    //* EXAM
    var study = document.getElementById('study').value;
    if (study == "Other") {
        study = document.getElementById('otherStudy').value;
    }
    var study2 = document.getElementById('study2').value;
    if (study2 == "Other") {
        study2 = document.getElementById('otherStudy2').value;
    }
    study = study + " " + study2;
    var sedation = document.getElementById('sedation').value;
    var findings = document.getElementById('findings').value;
    var interpretation = document.getElementById('interpretation').value;
    var recommendation = document.getElementById('recommendation').value;

    var filename = document.getElementById('filename').value;
    if (filename.trim() == "") {
        filename = document.getElementById('normFilename').value;
    }


    var doc = new jsPDF('p', 'in', 'letter'),
        sizes = [10, 16, 12],
        fonts = [
            ['Helvetica', 'bold'],
            ['Helvetica', '']
        ],
        size, lines,
        verticalOffset = 1.75,
        text = [];

    //* Basics
    text[0] = ['report', 'ULTRASOUND REPORT'];
    text[1] = ['Date:', date];

    text[2] = ['Patient:', patName];
    text[3] = ['Owner/Farm:', ownName];
    text[4] = ['RDVM:', RDVM];

    text[5] = ['Species:', species];
    text[6] = ['Breed:', breed];
    text[7] = ['Sex:', gender];
    text[8] = ['Age:', age];

    text[9] = ['History:', patHistory];
    //* EXAM
    text[10] = ['title', 'EXAM'];
    text[11] = ['Study:', study];
    text[12] = ['Sedation:', sedation];
    text[13] = ['Findings:', findings];
    text[14] = ['Interpretation:', interpretation];
    text[15] = ['Recommendation:', recommendation];

    doc.addImage(RRL, 'png', 1.75, 0.25, 5, 1.5);

    /* Loops through all the text areas to print on PDF */
    for (var i in text) {
        /* Makes sure i Has value */
        if (text.hasOwnProperty(i)) {
            bold = fonts[0];
            regFont = fonts[1];
            /* if i's first value is title (main title for pdf display) */
            if (text[i][0] == 'title') {
                size = sizes[1];
                lines = doc.setFont(bold[0], bold[1])
                    .setFontSize(size)
                    .splitTextToSize(text[i][1], 6.5);
                doc.text(0.5, 30, lines);
                verticalOffset += (lines.length + 0.5) * size / 72;
                /* If i's first value is report (only one should enter here) */
            } else if (text[i][0] == 'report') {
                size = sizes[2];
                lines = doc.setFont(bold[0], bold[1])
                    .setFontSize(size)
                    .splitTextToSize(text[i][1], 6.5);
                doc.text(3.25, verticalOffset + size / 72, lines);
                verticalOffset += (lines.length + 0.5) * size / 72;
                /* Enters if i's first value is the normal text (most values will go in here) */
            } else {
                size = sizes[0];
                if (i == 2) { // i 2 && 5 enter here (this is done so they are on the same line)
                    // bolded text - 2
                    lines = doc.setFont(bold[0], bold[1])
                        .setFontSize(size)
                        .splitTextToSize(text[i][0], 6.5);
                    doc.text(0.5, verticalOffset + size / 72, lines);
                    // value text - 2
                    lines = doc.setFont(regFont[0], regFont[1])
                        .setFontSize(size)
                        .splitTextToSize(text[i][1], 5.5);
                    doc.text(1.5, verticalOffset + size / 72, lines);
                    // bolded text - 5
                    lines = doc.setFont(bold[0], bold[1])
                        .setFontSize(size)
                        .splitTextToSize(text[5][0], 6.5);
                    doc.text(4.5, verticalOffset + size / 72, lines);
                    // value text - 5
                    lines = doc.setFont(regFont[0], regFont[1])
                        .setFontSize(size)
                        .splitTextToSize(text[5][1], 5.5);
                    doc.text(5.5, verticalOffset + size / 72, lines);
                    verticalOffset += (lines.length + 0.75) * size / 72;
                } else if (i == 3) { //i 3 && 6 enter here
                    // bolded text - 3
                    lines = doc.setFont(bold[0], bold[1])
                        .setFontSize(size)
                        .splitTextToSize(text[i][0], 6.5);
                    doc.text(0.5, verticalOffset + size / 72, lines);
                    // value text - 3
                    lines = doc.setFont(regFont[0], regFont[1])
                        .setFontSize(size)
                        .splitTextToSize(text[i][1], 5.5);
                    doc.text(1.5, verticalOffset + size / 72, lines);
                    // bolded text - 6
                    lines = doc.setFont(bold[0], bold[1])
                        .setFontSize(size)
                        .splitTextToSize(text[6][0], 6.5);
                    doc.text(4.5, verticalOffset + size / 72, lines);
                    // value text - 6
                    lines = doc.setFont(regFont[0], regFont[1])
                        .setFontSize(size)
                        .splitTextToSize(text[6][1], 5.5);
                    doc.text(5.5, verticalOffset + size / 72, lines);
                    verticalOffset += (lines.length + 0.75) * size / 72;
                } else if (i == 4) { // i 4 && 7 enter here
                    // bolded text - 4
                    lines = doc.setFont(bold[0], bold[1])
                        .setFontSize(size)
                        .splitTextToSize(text[i][0], 6.5);
                    doc.text(0.5, verticalOffset + size / 72, lines);
                    // value text - 4
                    lines = doc.setFont(regFont[0], regFont[1])
                        .setFontSize(size)
                        .splitTextToSize(text[i][1], 5.5);
                    doc.text(1.5, verticalOffset + size / 72, lines);
                    // bolded text - 7
                    lines = doc.setFont(bold[0], bold[1])
                        .setFontSize(size)
                        .splitTextToSize(text[7][0], 6.5);
                    doc.text(4.5, verticalOffset + size / 72, lines);
                    // value text - 7
                    lines = doc.setFont(regFont[0], regFont[1])
                        .setFontSize(size)
                        .splitTextToSize(text[7][1], 5.5);
                    doc.text(5.5, verticalOffset + size / 72, lines);
                    verticalOffset += (lines.length + 0.75) * size / 72;
                } else if (i == 8) { // i 8 is the only one that enters here
                    // bolded text - 8
                    lines = doc.setFont(bold[0], bold[1])
                        .setFontSize(size)
                        .splitTextToSize(text[i][0], 6.5);
                    doc.text(4.5, verticalOffset + size / 72, lines);
                    // value text - 8
                    lines = doc.setFont(regFont[0], regFont[1])
                        .setFontSize(size)
                        .splitTextToSize(text[i][1], 5.5);
                    doc.text(5.5, verticalOffset + size / 72, lines);
                    verticalOffset += (lines.length + 0.75) * size / 72;
                    /* this is where the bigger text area  */
                } else if (i > 8 || i == 1) {
                    // bolded text
                    lines = doc.setFont(bold[0], bold[1])
                        .setFontSize(size)
                        .splitTextToSize(text[i][0], 6.5);
                    if (text[i][0] == 'Date:') {//moves date to the right side of the PDF - bold header
                        doc.text(6, verticalOffset + size / 72, lines);
                    } else {
                            doc.text(0.5, verticalOffset + size / 72, lines);
                    }
                    // value text
                    lines = doc.setFont(regFont[0], regFont[1])
                        .setFontSize(size)
                        .splitTextToSize(text[i][1], 5.5);
                    if (text[i][0] == 'Date:') {//moves date value to the right of PDF - value
                        doc.text(6.5, verticalOffset + size / 72, lines);
                    } else {
                        doc.text(1.75, verticalOffset + size / 72, lines);
                    }

                    /* Puts more spacing between the last three text area values */
                    if (i == 13 || i == 14 || i == 15) {
                        verticalOffset += (lines.length + 1.5) * size / 72;
                        if (i == 14) {//puts line after interpretation with vertical offset for line
                            doc.setLineWidth(1 / 72);
                            doc.line(0.5, verticalOffset + size / 72, 7.5, verticalOffset + size / 72);
                            verticalOffset += (13 / 72);
                        }
                    } else {
                        verticalOffset += (lines.length + 0.75) * size / 72;
                        if (i == 9) {//puts line after history
                            doc.setLineWidth(1 / 72);
                            doc.line(0.5, verticalOffset + size / 72, 7.5, verticalOffset + size / 72);
                        }
                    }
                }


            }

        }
    }
    doc.addImage(sign, 'jpeg', 6, verticalOffset + size / 72, 1.5, .5);
    verticalOffset += .4;
    doc.line( 5.85, verticalOffset + size / 72, 7.5, verticalOffset + size / 72);
    verticalOffset += .15;
    doc.setFontType('italic');
    doc.text(5.9, verticalOffset + size / 72, "Colton R. Thacker, DVM");
    doc.save(filename + '.pdf');
}


function isMobileDevice() {
    console.log((typeof window.orientation !== "undefined") || (navigator.userAgent.indexOf('IEMobile') !== -1));
    return (typeof window.orientation !== "undefined") || (navigator.userAgent.indexOf('IEMobile') !== -1);
};